import React, { Component } from 'react';
import { HashRouter, Route, Switch } from 'react-router-dom';
import './App.scss';
import Home from './components/Views/Home';
import Services from './components/Views/Services';
import Courses from './components/Views/Courses';
import About from './components/Views/About';
import Contact from './components/Views/Contact';
import Dashboard from './components/Views/Dashboard';
import DeviceManagement from './components/Views/Devicemanagement'

const loading = () => <div className="animated fadeIn pt-3 text-center"><div className="sk-spinner sk-spinner-pulse"></div></div>;

// Containers
const DefaultLayout = React.lazy(() => import('./containers/DefaultLayout'));

// Pages
const Login = React.lazy(() => import('./components/Views/Pages/Login'));
const Register = React.lazy(() => import('./components/Views/Pages/Register'));
const Page404 = React.lazy(() => import('./components/Views/Pages/Page404'));
const Page500 = React.lazy(() => import('./components/Views/Pages/Page500'));

class App extends Component {

  render() {
    return (
      <HashRouter>
          <React.Suspense fallback={loading()}>
            <Switch>
              <Route exact path="/register" name="Register Page" render={props => <Register {...props}/>} />
              <Route exact path="/404" name="Page 404" render={props => <Page404 {...props}/>} />
              <Route exact path="/500" name="Page 500" render={props => <Page500 {...props}/>} />
              {/* <Route path="/" name="Home" render={props => <DefaultLayout {...props}/>} /> */}
      
              {/* <Route path="/" exact><Home /></Route> */}
              <Route path="/services"><Services /></Route>
              <Route path="/courses"><Courses /></Route>
              <Route path="/about"><About /></Route>
              <Route path="/contact"><Contact /></Route>
              <Route path="/dashboard"><Dashboard /></Route>
              <Route path="/devicemanagement"><DeviceManagement /></Route>

            </Switch>
          </React.Suspense>
      </HashRouter>
    );
  }
}

export default App;
